import React, { useState, useEffect } from "react";
import { useNavigate, useParams, Link } from "react-router-dom";
import { qnBuffer, choiceBuffer } from "./Home";
import {StyledButton, StyledForm, StyledFormWrapper, StyledHeader} from "./Style.js"

function Summary() {

  const userId = parseInt(useParams().id)
  const resp_url = "/questions/responses"
  const navigate = useNavigate()
  const [enableEdit, setEnableEdit] = useState("disabled")
  const [resp, setResp] = useState({
    name: "",
    colour: {
      Blue: false,
      Red: false,
      Green: false,
      Yellow: false,
      Purple: false,
      Pink: false
    },
    prog_lang: "",
    languages: {
      English: false,
      Chinese: false,
      Malay: false,
      Tamil: false,
      Hindi: false
    },
    would_pay: ""
  })

  const handleEdit = () => {
    setEnableEdit(!enableEdit)
  }

  const handleSubmit = async (e) => {
    e.preventDefault()

    const newResponse = {
      method: "PUT",
      mode: "cors",
      headers: {'Content-Type': 'application/json'},
      id: userId,
      body: JSON.stringify(resp)
    }
    const response = await fetch(resp_url, newResponse) // post request to server 
    const server_response = await response.json()
    console.log("server replied:", server_response)
    setEnableEdit(!enableEdit)
    alert("Response updated")
  }

  useEffect(async () => {
    await fetch(`http://localhost:3500/questions/responses/${userId}`)
      .then(res => res.json())
      .then(resJson => {setResp(resJson.data)})
  }, [])

  function handleChange(e) {
    const newData = { ...resp } // copy curr data
    newData[e.target.id] = e.target.value
    setResp(newData)
  }

  function handleCheckbox(e) {
    const newData = { ...resp } // copy curr data
    const updatedField = newData[e.target.id]
    updatedField[e.target.value] = e.target.checked
    newData[e.target.id] = updatedField
    setResp(newData)
  }

  function generateCheckBoxes(arr =[], _id, _type) {
    return (
      arr.map(item => 
      <p><input type={_type} name={_id} id={_id} value={resp[_id].item} disabled={enableEdit} onChange={handleCheckbox} checked={resp[_id].item}/> {item}</p>
      )
    )
  }

  return (
  <div>
    <StyledButton onClick={() => navigate("/")}>Home</StyledButton>
    <StyledHeader>Your response</StyledHeader>
    <StyledFormWrapper>
      <StyledForm onSubmit={e => handleSubmit(e)}>
        <div>
          <label>{qnBuffer[0]}</label>
          <p><input type="text" id="name" value={resp.name} disabled={enableEdit} onChange={handleChange} /></p>
        </div>
        <div>
          <label>{qnBuffer[1]}</label>
          <div>{generateCheckBoxes(choiceBuffer[1], "colour", "checkbox")}</div>
        </div>
        <div>
          <label>{qnBuffer[2]}</label>
          <div>{generateCheckBoxes(choiceBuffer[2], "prog_lang", "radio")}</div>
        </div>
        <div>
          <label>{qnBuffer[3]}</label>
          <div>{generateCheckBoxes(choiceBuffer[3], "languages", "checkbox")}</div>
        </div>
        <div>
          <label>{qnBuffer[4]}</label>
          <div>{generateCheckBoxes(choiceBuffer[4], "would_pay", "radio")}</div>
        </div>
        <button disabled={enableEdit} type="submit">Submit</button>
        <button disabled={!enableEdit} onClick={handleEdit}>Edit</button>
      </StyledForm>
      </StyledFormWrapper>
    </div>
  )
};

export default Summary;
